import "./App.css";
import Form from "./Form";
import MapBasics from "./Map";
import MenuAppBar from "./Header";
import Footer from "./Footer";

function App() {
  return (
    <>
      <MenuAppBar></MenuAppBar>
      <div>
        <Form></Form>
      </div>
      <div
        style={{
          position: "absolute",
          right: "5%",
          top: "20%",
          zIndex: "-4px",
        }}
      >
        <MapBasics></MapBasics>
      </div>
      <div justify="center" style={{ margin: "20%" }}>
        <Footer></Footer>
      </div>
    </>
  );
}

export default App;
